import React, { Fragment } from "react";

import LogoName from "../components/logoName";
import LogoImage from "../components/logoImage";

const logoletras = "/images/giftu.png";
const logoimage = "/images/logo.ong";

const Header = () => {
	return (
		<Fragment>
			<LogoName src={logoletras} alt="logo name" />
			<LogoImage src={logoimage} alt="logo imagen" />
		</Fragment>
	);
};

export default Header;
